    "Nursing Home - Falls within the Past 30 days",nt"tracking_summary": {ntt"total":
    12,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-15T04:23:30.283365",nt"name": "nursing-home-falls-within-the-past-30-days",nt"isopen":
    true,nt"url": null,nt"notes": "<p>Percent of residents reporting one or
    more falls within the past 30 days. The Minimum Data Set (MDS) is part of the federally
    mandated process for clinical assessment of all residents in Medicare or Medicaid
    certified nursing homes. This process provides a comprehensive assessment of each
    residents functional capabilities and helps nursing home staff identify health problems.
    Resident Assessment Protocols (RAPs), are part of this process, and provide the
    foundation upon which a residents individual care plan is formulated. MDS assessment
    forms are completed for all residents in certified nursing homes, regardless of
    source of payment for the individual resident. MDS assessments are required for
    residents on admission to the nursing facility and then periodically, within specific
    guidelines and time frames. In most cases, participants in the assessment process
    are licensed health care professionals employed by the nursing home. MDS information
    is transmitted electronically by nursing homes to the MDS database in their respective
    States. MDS information from the State databases is captured into the national MDS
    database at CMS. Data from the MDS for 1st quarter 2005 through 3rd quarter 2010
    are reported. In future years, this measure will be changing to percentage of long-term
    nursing facility residents with major falls. The data source will then be MDS 3.0.</p>n",nt"license_title":
